import React from "react";
import { Navbar, Nav, Form, FormControl, Container } from "react-bootstrap";
import { Link } from "react-router-dom";
import { FaHospitalSymbol } from "react-icons/fa"; // New symbol (medical cross)


function AppNavbar() {
  return (
    <Navbar expand="lg" style={{ backgroundColor: "#ffccd5" }} className="py-3">
      <Container fluid>

        {/* Left: Logo + Title */}
        <Navbar.Brand as={Link} to="/home" className="d-flex align-items-center me-auto">
          <FaHospitalSymbol size={26} color="darkred" className="me-2" />
          <span style={{ fontWeight: "bold", fontSize: "20px", color: "#800000" }}>
            Emergency System
          </span>
        </Navbar.Brand>

        {/* Center: Search Bar */}
        <div className="d-none d-lg-flex mx-auto" style={{ width: "40%" }}>
          <Form className="d-flex w-100">
            <FormControl
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
          </Form>
        </div>

        {/* Right: Navigation Links */}
        <Nav className="ms-auto">
          <Nav.Link as={Link} to="/home">Home</Nav.Link>
          <Nav.Link as={Link} to="/register">Register</Nav.Link>
          <Nav.Link as={Link} to="/profile">My Profile</Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default AppNavbar;
